// )

const item=(props)=>{



  const { data, error, loading } = useQuery(getEmpresas);

  const element= props.variables;


  // if (loading) {
  //   return <div>Loading...</div>;
  // };
  // if (error) {
  //   return <div>Error! {error.message}</div>;
  // };

  return (

        <tr key={uuid()}>
          <th key={(element._id)} className="text-right">
            {(element.nombre)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.correo)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.canton)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.provincia)}
          </th>
        </tr>


  )
};

export default item;
